import React from "react";

export default function Todo(todos) {
  console.log("todos : " + todos);
  return (
    <>
      <div>
        {todos.map((todo) => (
          <>
            <div>todo.id</div>
            <div>todo.headline</div>
          </>
        ))}
      </div>
    </>
  );
}
